import React, {Component} from 'react';
import {NavLink} from 'react-router-dom';
import logo from '../images/logo.png'
import './NavBar.css'
//mport MenuButton from "./HamburgerButton/HamburgerButton";


class NavBar extends Component {
    constructor(props){
        super(props);
        this.state = {
            tabs:['Home','About Us','Contact Us','FAQs','MEMBERS'],
            open:false,
        };
    }

    handleClick=()=>{
        this.setState((prevState)=>{
            return {open:!prevState.open}
        })
    };

    render() {
        return (
            <div className="newNav">
                <nav className="nav_bar">
                    <div className="logo_container">
                        <img className="genbukan_logo" src={logo} alt="logo"/>
                    </div>
                    {/* <div className="menuBtn">
                        <MenuButton open={this.state.open} onClick={this.handleClick}/>
                    </div> */}
                    <ul className="nav_tags">
                        <li>
                            <NavLink className="navTag" exact to="/" activeStyle={{borderBottom:'#957546 solid 6px'}}>HOME</NavLink>
                        </li>
                        <li>
                            <NavLink className="navTag" to="/ABOUTUS" activeStyle={{borderBottom:'#957546 solid 6px'}}>ABOUT US</NavLink>
                        </li>
                        <li>
                            <NavLink className="navTag" to="/CONTACTUS" activeStyle={{borderBottom:'#957546 solid 6px',}}>CONTACT US</NavLink>
                        </li>
                        <li>
                            <NavLink className="navTag" to="/FAQS" activeStyle={{borderBottom:'#957546 solid 6px',}}>FAQs</NavLink>
                        </li>
                        <li>
                            <NavLink className="navTag" to="/MEMBERS" activeStyle={{borderBottom:'#957546 solid 6px',}}>MEMBERS</NavLink>
                        </li>
                    </ul>
                </nav>
            </div>
        );
    }
}

export default NavBar;
